import Card from './CardComponent'
import '../styles/Expenses.css'

function Expenses(props) {
    return (
        <div className="expenses">{props.expenses.map((expense) => (
            <Card title={expense.title} amount={expense.amount} date={expense.date}></Card>
        ))}</div>
    );
}

export default Expenses;
